                            Text = "<p>شرکت تیک تو اینترتینمنت کمپین‌های بمباران نظرات منفی برای آسیب زدن به جایگاه بازی‌ها را یک ریسک جدی در تجارت بازی‌های ویدیویی می‌داند.</p><p>شرکت Take-Two Interactive در ارتباط با سرمایه‌گذاران خود به موضوع خاصی در بازار کنونی بازی‌های ویدیویی پرداخته است و دیدگاه شفاف‌تری را نسبت به تأثیرات مستقیم و غیرمستقیم آن در دیگر زمینه‌ها ارائه می‌کند. ناشر بازی GTA 6&nbsp;بمباران نظرات منفی نسبت به بازی‌ها را یک ریسک جدی در این صنعت توصیف می‌کند. منظور از «بمباران نظرات منفی»، ایجاد کمپین‌های بزرگی برای ثبت نظرات منفی در نقد و بررسی بازی‌ها است که معمولاً نه فقط برای رساندن یک پیام اعتراضی به سازندگان بازی‌ها توسط جامعه مخاطبان، بلکه بیشتر با هدف آسیب رساندن به جایگاه یک بازی صورت می‌گیرد.</p><p>درحالی‌که ظهور پدیده‌ی بمباران نظرات در نقد و بررسی بازی‌ها تاحد زیادی با فراگیر شدن حداکثری رسانه‌های اجتماعی و تأثیر آن بر زندگی روزمره همزمان می‌شود، قدمت این پدیده به زمانی اولین پلتفرم‌های جمع آوری آنلاین نظرات کاربران ایجاد شدند، برمی‌گردد. از اوایل تا اواسط دهه ۲۰۱۰ بود که با ایجاد زمینه‌هایی برای ثبت نظرات و انتقادات کاربران توسط استیم، پلی استیشن و ایکس باکس، گیمرها پلتفرم بزرگ‌تری را برای شنیده شدن صدای خود توسط بازیسازان دریافت کردند.</p><figure class=\"image\"><img src=\"https://cdn.zoomg.ir/2024/7/xbox-exclusives-review-bombed-metacritic.jpg\" alt=\"نمرات منفی در متاکریتیک\"></figure><p>در طول این سال‌ها، تیک تو اینتراکتیو در معرض بسیاری از این کمپین‌های نظرات کاربران قرار گرفته است. این غول بزرگ صنعت گیمینگ حالا این پدیده را به‌عنوان یک ریسک تجاری پذیرفته است تا مستقیماً تأیید کند که این این قبیل اقدامات کارآمد بوده‌اند. Game File گزارش می‌دهد که پرونده مشهور به 10K شرکت تیک تو، شامل گزارشی از عملکرد سالانه این شرکت می‌شود که در آن از اهمیت حفظ امتیاز و رتبه بندی بازی‌ها در پلتفرم‌های ترد پارتی و تأثیر آن رو موفقیت یک بازی گفته شده است.</p><p>براین‌اساس گفته می‌شود که این موضوع در زمینه‌های مختلفی همچون قابلیت دیده شدن یک محصول در پلتفرم مربوطه تأثیر گذار است که در نتیجه‌ی الگوریتم‌های شناسایی محصولات محبوب کاربران در این پلتفرم‌ها ایجاد شده است. ازاین‌رو به‌وجود آمدن کمپین‌هایی موسوم به «Defamation campaigns» یا «کمپین‌های تخریب و افترا» با هدف آسیب رساندن به جایگاه یک بازی می‌تواند تأثیر مخربی روی عملکرد بازی و در نتیجه از دست دادن بازیکنان و درآمدهای آن داشته باشد.</p><p>سند ارزیابی ریسک تیک تو نشان می‌دهد که چنین پدیده‌هایی می‌توانند برای شرکت هزینه در پی داشته باشند تا بلکه ازطریق افزایش هزینه‌های بازاریابی خود بتواند با اثرات سوء آن مقابله کند. اگرچه این شرکت خاطر نشان کرد که اگر یک محصول پایین‌تر از حدانتظار ظاهر شود، بدیهی است که رگبار نظرات منفی از سوی کاربران گاهی اوقات ممکن است تقصیر عملکرد ضعیف خود سازندگان باشد.</p><p>درواقع این شرکت کمپین‌‎های اعتراضی را جدا از این مسئله می‌داند که به همان اندازه حائز اهمیت هستند؛ به‌عنوان مثال سال گذشته نسخه PS4 و نینتندو سوییچ بازی Red Dead Redemption با بمباران نظرات منفی کاربران مواجه شد؛ اما این اتفاق به‌دلیل بد بودن این محصول نبود؛ بلکه به‌دلیل این بود که کاربران این بازی را نسخه بازسازی شده‌ی مناسبی نمی‌دانستند.</p><figure class=\"image\"><img src=\"https://cdn.zoomg.ir/2024/7/sony-helldivers-2-psn-account-link-reverse-decision-1.jpg\" alt=\"Helldivers 2 و موضوع لینک کردن حساب PSN سونی\"></figure><p>ناشر GTA 6 تنها شرکت بزرگی نیست که تأیید می‌کند نظرات کاربران نسبت به بازی‌ها در چند سال گذشته روی فروش بازی‌ها تأثیر زیادی داشته است. سونی هم در ماه می امسال و پس از هجوم گسترده کاربران برای ثبت نظرات منفی نسبت به Helldivers 2 به‌دلیل نیاز به لینک شدن اکانت PSN کاربران استیم، اظهارات مشابهی را مطرح کرده بود.</p>",
